import { useState } from 'react';
import Aluno from './components/alunos';

function Context() {
  const [nomeAluno, setNomeAluno] = useState('cascata')

  return (
    <div>
      <h1>Gatinhos</h1>
      <hr />

      <Aluno nome={nomeAluno} mudaNome = {setNomeAluno}/>
    </div>
  );
}

export default Context;
